import React from "react";

export default function Number(props) {



return (
<div>
        <h1 style={props.number >= 0 ? { color: 'green' } : { color: 'red' }}>{props.number}</h1>

     {props.darkMoode ? <h1>3</h1>:<h1>2</h1>}
     </div>
    )

}
